import classes from './Experiences.module.css';
import Container from 'react-bootstrap/esm/Container';
import Col from 'react-bootstrap/esm/Col';
import Row from 'react-bootstrap/esm/Row';

const psPath = "https://media.licdn.com/dms/image/C560BAQFJ1mxjVEoZGw/company-logo_200_200/0/1658952736311?e=1687996800&v=beta&t=LWSrOMFl3VfsQvcmaznwT1V0PgnDnVD1cCO5dFn2xkQ";

const Experiences = () => {
    return ( 
        <section className={classes.experiences}>
            <Container className="experience_list">
                <h3 className={classes.experiences__header}>Experiences</h3>
                <Row>
                    <Col md={9}>
                        <p className={classes.experiences__title}>Software Engineer Intern</p>
                    </Col>
                    <Col md={3}>
                        <p className={classes.experiences__date}>Jun 2022 - Aug 2022</p>
                    </Col>
                </Row>
                <Col sm={3}>
                    <div className={classes["experiences__company-wrapper"]}>
                        <img className={classes["experiences__company-logo"]} src={psPath} alt="Publicis Sapient logo" />
                        <p className={classes.experiences__company}>Publicis Sapient</p>
                    </div>
                </Col>
                <Col>
                    <p className={classes.experiences__accomplishment}>
                        Lorem ipsum dolor sit amet consectetur adipisicing elit orem ipsum dolor sit amet consectetur, adipisicing elit.
                    </p>
                </Col>
            </Container>
        </section>
     );
}

export default Experiences;
